// Implementation of hook procedure

LRESULT CALLBACK KeyboardEvent(int nCode, WPARAM wParam, LPARAM lParam)
{
	if (nCode == HC_ACTION) {

		switch (wParam) {

		case WM_KEYDOWN:

		case WM_SYSKEYDOWN:

			// Variable to store message identifier

			dwMsg = 1;

			// Casting pointer lParam to KBDLLHOOKSTRUCT pointer

			kbdStruct = *((KBDLLHOOKSTRUCT*)lParam);

			// Getting identifier of pressed key

			char key = kbdStruct.vkCode;

			return true;

			break;

		default:

			// Variable to store message identifier

        		dwMsg = 0;
			return CallNextHookEx(keyboardHook, nCode,
				wParam, lParam);

			break;
		}
	}

	return CallNextHookEx(0, nCode, wParam, lParam);

}

// Function to set a hook

void SetHook()
{
   // Get the current application identifier. 

   hInstance = GetModuleHandle(0);
   if (hInstance == 0) {
      hInstance = LoadLibrary((LPCWSTR)"User32");
   }


   // Setting hook

   keyboardHook = SetWindowsHookEx(WH_KEYBOARD_LL, (HOOKPROC)
		KeyboardEvent, hInstance, 0);

   // If hook failed

	if (!keyboardHook) {

	// Returns zero 

		cout << "SetWindowsHookEx failed. Error : " << 
		GetLastError() << endl;

 }

}

// Function to raising changes

void UnHook()
{
	// Frees hook

   BOOL ret = UnhookWindowsHookEx(keyboardHook);


	// If hook freed

   if (ret == false) {
   	cout << "UnhookWindowsHookEx failed" << GetLastError()
   		<< endl;
   }

}

